import React, { Component } from 'react'
import "./style.css"
import { spawn } from 'child_process';



function SuccessMsg(props){
    return(
        <div class = {props.msgType}>

            <spam class="alert">{props.alertName}</spam>
            <spam class="msg">{props.alertMsg}</spam>

        </div>
    )
}

export default SuccessMsg;
